import 'rsuite/dist/styles/rsuite-default.css';
import React, { ReactNode } from 'react';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';

export type SocialIconVprops={
    icon: string;
    url: string;
    color: string;
    target: string;
}


// export type CompanyInfoVprops={
//    containerBackgroundColor?:string;
//     textColor?:string;
//     borderColor?:string;
//     companyLink?:string;
//     logoSrc?:string;
//     logoAlt?:string;
//     address?:string;
//     contactNumber?:string;
//     email?:string;
//     copyright?:string;
//     companyName?:string;
// }


export type ContainerVprops = {
  classes?:	object;
  className?:string;
  component?: Element;
  disableGutters?: boolean;
  fixed?:	boolean;
  maxWidth?: string;
   children?: any;
};

export type GridVprops ={
alignContent?:string;
alignItems?:string;
children?:	ReactNode;
className?:string;
classes?:	object;
 component?: Element;
container?:	boolean;
direction?:string;
item?:boolean;
justify?:string;
wrap?:string;
spacing?:number;
xl?:boolean|string|number;
xs?:boolean|string|number;
md?:boolean|string|number;
lg?:boolean|string|number;
sm?:boolean|string|number;
zeroMinWidth?:	boolean;
}


export const ContainerV = (props: ContainerVprops) => {
  let _containerprops = {...props};
  return <Container {..._containerprops}>{props.children}</Container>;
};

export const GridV = (props: GridVprops ) => {
  let _gridVprops  = {...props};
  return <Grid {..._gridVprops}>{props.children}</Grid>;
};
